Functions are defined by prefixing some name with the let keyword and followed by \(n \) arguments. The right hand side of the = sign denotes the logic that will follow when called. let add x y = x + y add 2 4 F# has two types of function calls, infix and prefix. Let's take a look at the addition (+) function to see how they differ. // Infix notation
2 + 4 // Prefix notation
(+) 2 4 Looking at the example above we can determine that our custom function add() is used via prefix notation. {{#quiz ../../quizzes/2-5.toml}}

