Discriminated unions provide support for values that can be one of a number of named cases, possibly each with different values and types [1] In other words, they can essentially be thought of as Enums. type Suit = Spades | Clubs | Hearts | Diamonds type Shape = | Rectangle of width:float * heigh:float | Circle of radius:float | Prism of width:float * float * height:float // Showcase of different ways to instantiate Unions
let rect = Rectangle (height = 1.3, width = 10.0)
let circ = Circle (1.0)
let prism = Prism (5., 2.0, height = 3.0) // Matching discriminated unions
let getShapeHeight shape = match shape with | Rectangle(height = h) -> h | Circle(radius = r) -> 2. * r | Prism(height = h) -> h // Recursive discriminated unions
type Tree = | Leaf of value:int | Parent of value:int * left:Tree * right:Tree let rec Height tree = match tree with | Leaf(_) -> 1 | Parent(value=v; left=l; right=r) -> (max (Height l) (Height r)) + 1 {{#quiz ../../quizzes/3-7.toml}} [1] F# Documentation - Discriminated Unions

